      http.setResponseCookie($cookie,$cookies[$cookie],"path=/; secure; HttpOnly");
   }
   if( string.regexmatch( $cookie, "^__csrf" ) ) {
      http.setResponseCookie($cookie,$cookies[$cookie],"path=/; secure; HttpOnly");
   }
   if( string.regexmatch( $cookie, "^JSESSIONID" ) ) {
      http.setResponseCookie($cookie,$cookies[$cookie],"path=/; secure; HttpOnly");
