my $output = { "version" => 1,
               "nodes" => [],
               "code" => 200 };

sub output_json()
{
   print encode_json( $output );
}

sub error($$)
{
   my( $code, $msg ) = @_;
   $output->{'error'} = $msg;
   $output->{'code'} = $code;
   delete( $output->{'nodes'} );
   output_json();
   exit( 1 );
}

sub info($)
{
   my( $msg ) = @_;
   $output->{'info'} .= $msg . ". ";
}

my $opts = {};
if( !GetOptions( $opts,
                 'nodes|n:s',
                 'info|i',
                 'verbose|v',
               )
   ) {
   error( 400, "Invalid arguments for PCS/PPS Service Discovery Script" );
}

# Get a list of nodes, might be comma or space separated
my @nodes = ();
my $nodes_arg = $opts->{'nodes'};
if( $nodes_arg ) {
   @nodes= split( /(?:,\s*)|(?:\s+)/, $nodes_arg );
}

my $verbose = $opts->{'verbose'};
my $info_opt = $opts->{'info'};

if( !scalar( @nodes) ) {
   error( 400, "Invalid arguments for PCS/PPS Service Discovery Script: '--nodes' required." );
}

# The format of each node is <hostname>:<port>/<maxusers>. Split out
# each component then iterate through all the nodes provided and
# return the weight encoded in JSON to the Service Discovery lb code.

my %hosts;

foreach my $node ( @nodes ) {
   my ( $host_and_port, $maxusers ) = split( '/', $node, 2 );
   my ( $host, $port ) = 0;

   # RFC 3986, section 3.2.2, IPv6 addresses must use [1::0]:port format
   if( $host_and_port =~ m/(.*):(\d+)/ ) {
      $host = $1;
      $port = $2;
   } else {
      error( 400, "Cannot split $host_and_port into host:port" );
   }

   # Run curl and look for a regex matching "USER-COUNT=1;"
   my $healthcheck_url = "/dana-na/healthcheck/healthcheck.cgi?status=all";
   my $url = "https://" . $host . $healthcheck_url;

   print STDERR "host = $host\n" if $verbose;
   print STDERR "port = $port\n" if $verbose;
   print STDERR "maxusers = $maxusers\n" if $verbose;
   print STDERR "url = $url\n" if $verbose;

   open( HEALTH, "$ENV{ZEUSHOME}/admin/bin/httpclient -t 5 $url |" ) ||
     error( 400, "Cannot run $ENV{ZEUSHOME}/admin/bin/httpclient: $!" );
   my $first_line = <HEALTH>;

   # Check for 200 here. Ignore node if 404, 500, etc
   if ( !$first_line || $first_line !~ m/ 200 /) {
     info( "Health check API for " . $url . " didn't return 200 OK" );
     next;
   }
   print $first_line if $verbose;
   my $user_count = -1;
   while( <HEALTH> ) {
      print STDERR "http response:   $_" if $verbose;
      next unless /USER-COUNT=(\d+);/;
      $user_count = $1;
   }
   print STDERR "\n\n" if $verbose;
   close HEALTH || error( 400, "httpclient returned: $! $?" );
   my $weight = 0;

   # Couldn't parse the JSON output
   if( $user_count == -1 ) {
      info( "Cannot parse session count for $host" );
      print STDERR "Cannot parse session count for $host\n" if $verbose;
      $weight = 1;
   } else {
      $weight = $maxusers - $user_count;
      print STDERR "weight = $maxusers - $user_count = $weight\n" if $verbose;
   }


   $hosts{ $host }{ $port } = $weight;
}

my $max_weight = 0;
foreach my $host ( keys %hosts ) {
   foreach my $port (keys %{ $hosts{$host} }) {
      my $weight = $hosts{ $host }{ $port };
      if( $weight > $max_weight ) {
         $max_weight = $weight;
      }
   }
}
if( $max_weight > 100 ) {
   print STDERR "scaling down weights to <= 100\n" if $verbose;
   my $scale_factor = $max_weight / 100;
   foreach my $host ( keys %hosts ) {
      foreach my $port (keys %{ $hosts{$host} }) {
         my $weight = $hosts{ $host }{ $port };
         $weight /= $scale_factor;
         $hosts{ $host }{ $port } = $weight;  # Scale down each weight
      }
   }
}

foreach my $host ( keys %hosts ) {
   foreach my $port (keys %{ $hosts{$host} }) {
      my $weight = $hosts{ $host }{ $port };
      if( $weight ) {
         $weight = int( $weight );
         $port = int( $port );
         # Weights must be in the range 1-100
         $weight = 1 if( $weight < 1 );
         $weight = 100 if( $weight > 100 );
         if( $host =~ m/\[(.*)\]/ ) {
            $host = $1;
         }

         open( DNSLOOKUP, "$ENV{ZEUSHOME}/admin/bin/zdns -l $host |" ) ||
           error( 400, "Cannot run $ENV{ZEUSHOME}/admin/bin/zdns: $!" );

         my @ip_addrs;
         while( <DNSLOOKUP> ) {
           chomp;
           push( @{$output->{'nodes'}},
             { 'ip' => $_,
               'port' => int( $port ),
               'weight' => int( $weight )
             } );
         }
         info( "Host $host:$port, weight = $weight" ) if( $info_opt );
         close DNSLOOKUP || error( 400, "zdns returned: $! $?" );
      }
   }
}

output_json();
print "\n";

exit 0;
